import React from 'react'
import useTimer from '../hooks/useTimer';

function Timer() {
  const { state } = useTimer();
  const {tempo, random} = state;

  const abc = random % 2 === 0;

  console.log(abc);

  return (
    <div>
      <div>
        {random}
      </div>
      <div>
        {tempo}
      </div>
      <div>
        {abc && 'BINGO'}
      </div>
    </div>
  )
}

export default Timer
